const enterprise_html = `<div xmlns="http://www.w3.org/1999/xhtml" align="justify"><div class="name" ><h2>Enterprise</h2></div>
<div class="description"><strong>Description: </strong></div>
Enterprise refers to a for-profit business started and run by an entrepreneur.<br/>
People running such businesses are enterprising.<br/>
The roots of the word lie in the French word entreprendre (from prendre),<br/>
meaning ‘to undertake’, which in turn comes from the Latin “inter prehendere”<br/>
(seize with the hand). <div class ="categories"><strong>Categories: </strong>business, active</div>
<div class="examples"><strong>Examples: </strong>Airbus Commercial Aircraft, Airbus Helicopter, Airbus Defence&Space</div>
`
const enterprise_network_html = `<div xmlns="http://www.w3.org/1999/xhtml" align="justify"><div class="name" ><h2>Networked Enterprises</h2></div>
<div class="description"><strong>Description: </strong></div>
A set of enterprises collaborating relying on<br/>
collaboration protocols, each enterprise <br/>
of the network being a node of a networked organization.<br/>
It can also be a virtual organization supporting collaboration<br/>
between enterprise for a given purpose.
<div class ="categories"><strong>Categories: </strong>business, active</div>
<div class="examples"><strong>Examples:</strong>a supply chain working on a given product, an association representing <br/>
common interests of several enterprises</div>
`

const business_ecosystem_html = `<div xmlns="http://www.w3.org/1999/xhtml" align="justify"><div class="name" ><h2>(Digital) Business Ecosystem</h2></div>
<div class="description"><strong>Description: </strong></div>
A set of interdependant enterprises working in the same domain<br/>
 and contributing to the same value chain.<br>
When mature in terms of interoperability, the ecosystem governs the development of standards,<br/>
in particular the digital ones, in order to improve their business efficiency in a coopetition context.<br/>
An alternative definition:a Digital Business Ecosystem is a collaborative environment<br/> 
made up of different entities that co-create value through information and communication<br/>
technologies (ICTs) (Nachira, Dini, & Nicolai, 2007).
<div class ="categories"><strong>Categories: </strong>business, active</div>
<div class="examples"><strong>Examples:</strong>automative domain, with the set of Automative Industrial Standards<br/>
related to Manufacturing Data</div>
`

